import './App.css';
import { BrowserRouter, Navigate, Route, Routes } from 'react-router-dom';
import { Contacts } from './pages/Index'

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path='/*' element={<Navigate to="/user" />}/>
        <Route path="/user" element={<HomePage />} />
      </Routes>
    </BrowserRouter>
  )
}

export default App;
